// src/components/AttendanceRecords.js
import React, { useState, useEffect } from 'react';

const API_BASE = 'http://localhost:5000';

const AttendanceRecords = ({ branch = 'CSE' }) => {
  const [todayRecords, setTodayRecords] = useState([]);
  const [loading, setLoading] = useState(true);

  const loadTodayRecords = async () => {
    try {
      setLoading(true);
      const res = await fetch(`${API_BASE}/api/today_attendance/${branch}`);
      const data = await res.json();
      setTodayRecords(data);
    } catch (error) {
      console.error('Load records failed:', error);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    loadTodayRecords();
    const interval = setInterval(loadTodayRecords, 5000);
    return () => clearInterval(interval);
  }, [branch]);

  if (loading) {
    return (
      <div className="attendance-records-container">
        <div className="excel-table-container">
          <div className="excel-header">
            <h2>üìã Today's Attendance Records - {branch}</h2>
          </div>
          <div className="excel-loading">Loading records...</div>
        </div>
      </div>
    );
  }

  return (
    <div className="attendance-records-container">
      <div className="excel-table-container">
        <div className="excel-header">
          <h2>üìã Today's Attendance Records - {branch}</h2>
          <div className="excel-stats">
            <span>Total: {todayRecords.length}</span>
            <span>Unique: {new Set(todayRecords.map(r => r.admission_no)).size}</span>
          </div>
        </div>

        <div className="excel-table">
          <div className="excel-row header-row">
            <div className="excel-cell header-cell">S.No</div>
            <div className="excel-cell header-cell">Admission No</div>
            <div className="excel-cell header-cell">Name</div>
            <div className="excel-cell header-cell">Branch</div>
            <div className="excel-cell header-cell">Time</div>
            <div className="excel-cell header-cell">Status</div>
          </div>

          {todayRecords.length === 0 ? (
            <div className="excel-empty">
              No attendance records for today
            </div>
          ) : (
            todayRecords.map((record, index) => (
              <div key={`${record.admission_no}-${record.timestamp}`} className="excel-row">
                <div className="excel-cell">{index + 1}</div>
                <div className="excel-cell">{record.admission_no}</div>
                <div className="excel-cell">{record.name}</div>
                <div className="excel-cell branch-cell">{record.branch}</div>
                <div className="excel-cell time-cell">{formatTime(record.timestamp)}</div>
                <div className="excel-cell status-cell present-cell">
                  <span className="status-dot">‚óè</span>
                  Present
                </div>
              </div>
            ))
          )}
        </div>
      </div>
    </div>
  );
};

const formatTime = (timestamp) => {
  const date = new Date(timestamp);
  return date.toLocaleTimeString('en-US', { 
    hour12: false, 
    hour: '2-digit', 
    minute: '2-digit', 
    second: '2-digit' 
  });
};

export default AttendanceRecords;
